import React, { Component } from 'react';
import Header from './Header';
import './App.css';
import Nav from './Nav'
import SearchBar from './SearchBar'




class App extends Component {
  state = {
    city: ""
  }

  cityChanged = (event) => {
    this.setState({
      city: event.target.value
    });
  }

  render(){
  return (
    <div className="App">
      <Nav />
      <Header />
      <SearchBar cityChanged={this.cityChanged}/>
    </div>
  );
}
}

export default App;
